 if (Model0_rs->Model0_missed) {
  Model0_printk("\001" "4" "TCP: " "%s: %d output lines suppressed due to ratelimiting\n", Model0_get_current()->Model0_comm, Model0_rs->Model0_missed);

  Model0_rs->Model0_missed = 0;
 }
